import React from 'react'
import { Container, Nav, Navbar } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import "./css/navmenu.css";

function Postheader() {
    return (
        <div className="postheader_main">
        <div>
            <span>MENU1</span>
        </div>
        <div>
            <span>MENU2</span>
        </div>
        </div>
    )
}

export default Postheader
